    // Use PerformanceObserver to catch paint timing entries
    try {
      const paintObserver = new PerformanceObserver((list) => {
        for (const entry of list.getEntries()) {
          console.log('[Subpage 1]', entry.name + ':', entry.startTime.toFixed(2), 'ms');
        }
      });
      paintObserver.observe({ type: 'paint', buffered: true });
    } catch(e) {
      console.log('[Subpage 1] Paint Timing API not supported:', e.message);
    }

    // Use PerformanceObserver for LCP
    try {
      const lcpObserver = new PerformanceObserver((list) => {
        const entries = list.getEntries();
        const lastEntry = entries[entries.length - 1];
        if (lastEntry) {
          console.log('[Subpage 1] Largest Contentful Paint:', lastEntry.startTime.toFixed(2), 'ms');
          if (lastEntry.element) {
            console.log('[Subpage 1] LCP Element:', lastEntry.element.tagName, lastEntry.element.className || '(no class)');
            console.log('[Subpage 1] LCP Element outerHTML:', lastEntry.element.outerHTML.substring(0, 100) + '...');
          }
        }
      });
      lcpObserver.observe({ type: 'largest-contentful-paint', buffered: true });
    } catch(e) {
      console.log('[Subpage 1] LCP not supported:', e.message);
    }

    // Also log navigation timing on load
    window.addEventListener('load', () => {
      const navTiming = performance.getEntriesByType('navigation')[0];
      if (navTiming) {
        console.log('[Subpage 1] DOM Content Loaded:', navTiming.domContentLoadedEventEnd.toFixed(2), 'ms');
        console.log('[Subpage 1] Load Complete:', navTiming.loadEventEnd.toFixed(2), 'ms');
      }
    });

  </script>
